import { Button, Typography } from "@mui/material";
import Card from "@mui/material/Card";
import Piechart from "./Piechart";

const Dashboard = () => {
  return (
    <div>
      <div className="top_section" style={{backgroundColor:"#626262",  display: "flex",
            justifyContent:"space-evenly", alignItems: "center", padding: "10px", borderRadius: "15px",}}>
        <Card
          className="income_card"
          sx={{
            width: "355.41px",
            height: "181px",
            backgroundColor: "#9b9b9b",
            color: "#fff",
            display: "flex",
            justifyContent: "center",
            flexDirection: "column",
            alignItems: "center",
          }}
        >
          <Typography
            sx={{
              fontSize: "30px",
              fontWeight: "400",
              lineHeight: "34.47px",
              paddingBottom: "20px",
            }}
          >
            Wallet Balance:{" "}
            <span style={{ color: "rgba(157, 255, 91, 1)", fontWeight: "700" }}>
              &#x20B9; 4500
            </span>
          </Typography>
          <Button
            sx={{
              width: "80%",
              color: "#fff",
              backgroundColor: "rgba(181, 220, 82, 1)",
              borderRadius: "15px",
            }}
          >
            + Add Income
          </Button>
        </Card>

        <Card
          className="expense_card"
          sx={{
            width: "355.41px",
            height: "181px",
            backgroundColor: "#9b9b9b",
            color: "#fff",
            display: "flex",
            justifyContent: "center",
            flexDirection: "column",
            alignItems: "center",
          }}
        >
          <Typography
            sx={{
              fontSize: "30px",
              fontWeight: "400",
              lineHeight: "34.47px",
              paddingBottom: "20px",
            }}
          >
            Expense:{" "}
            <span style={{ color: "rgba(157, 255, 91, 1)", fontWeight: "700" }}>
              &#x20B9; 500
            </span>
          </Typography>
          <Button
            sx={{
              width: "80%",
              color: "#fff",
              backgroundColor: "rgba(181, 220, 82, 1)",
              borderRadius: "15px",
            }}
          >
            + Add Expense
          </Button>
        </Card>
        <Piechart />
      </div>
    </div>
  );
};

export default Dashboard;
